function getLocation(){return new Promise(function(t,o){navigator.geolocation.getCurrentPosition(t,o)})}$(document).ready(function(){getLocation().then(function(t){const o=t.coords.latitude,n=t.coords.longitude,a=0,c=100;$.ajax({url:`https://public-api.adsbexchange.com/VirtualRadar/AircraftList.json?lat=${o}&lng=${n}&fDstL=${a}&fDstU=${c}`,dataType:"jsonp",success:function(t){console.log(t);let o=t.acList.slice();o.sort((t,o)=>o.Alt-t.Alt),o.forEach(t=>{$(".airplanes-list tbody").append(`<tr>\n              <td>Logo</td>\n              <td>${t.Alt}</td>\n              <td>${t.CNum}</td>\n            </tr>`)})}})}).catch(function(t){console.error(t.message)})});